import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import Courts from './components/Courts'
import SingleCourt from './components/SingleCourt'
import Home from './components/Home'
import './App.css';
import Players from './components/Players'
import SinglePlayer from './components/SinglePlayer';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={Home}/>
          <Route exact path="/court" component={Courts}/>
          <Route exact path="/court/create" component={Courts}/>
          <Route exact path="/court/edit/:courtId" component={Courts}/>
          <Route exact path='/court/:courtId' component={SingleCourt}/>
          <Route exact path='/player/:courtId/create' component={Players} />
          <Route exact path='/player//edit' component={Players} />
          <Route path='/player/:playerId' component={SinglePlayer} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
